import React from 'react'
class Api extends React.Component {
    constructor() {
    super()
    this.state = {
        apiPredictionData: {},
        PassengerId:5,
        Pclass:3,
        Sex_male:1.0,
        Sex_female:0.0,
        Age:35.0,
        SibSp:0,
        Parch:0,
        Fare:8.0500,
        Embarked_S:1.0,
        Embarked_C:0.0,
        Embarked_Q: 0.0
    }
}

    componentDidMount() {
        fetch("/api/predict?v1= {}&v2=3&v3=1.0")
        .then(response => response.json())
        .then(data => this.setState({
            apiPredictionData: data
        }))
    }
    render() {
        console.log(this.state.apiPredictionData.predicted)
        // console.log(typeof(JSON.parse(this.state.apiData.python)))
        return(

            <div>
               <h2>{this.state.apiPredictionData.predicted}</h2>
            </div>
        )
    }

}




export default Api
